declare const subnet: ec2.Subnet;
declare const subnetFilter: ec2.SubnetFilter;
declare const topic: sns.Topic;
declare const updatePolicy: autoscaling.UpdatePolicy;
const commonAutoScalingGroupProps: autoscaling.CommonAutoScalingGroupProps = {
  allowAllOutbound: false,
  associatePublicIpAddress: false,
  autoScalingGroupName: 'autoScalingGroupName',
  blockDevices: [{
    deviceName: 'deviceName',
    volume: blockDeviceVolume,

    // the properties below are optional
    mappingEnabled: false,
  }],
  cooldown: cdk.Duration.minutes(30),
  desiredCapacity: 123,
  groupMetrics: [groupMetrics],
  healthCheck: healthCheck,
  ignoreUnmodifiedSizeProperties: false,
  instanceMonitoring: autoscaling.Monitoring.BASIC,
  keyName: 'keyName',
  maxCapacity: 123,
  maxInstanceLifetime: cdk.Duration.minutes(30),
  minCapacity: 123,
  newInstancesProtectedFromScaleIn: false,
  notifications: [{
    topic: topic,

    // the properties below are optional
    scalingEvents: scalingEvents,
  }],
  notificationsTopic: topic,
  replacingUpdateMinSuccessfulInstancesPercent: 123,
  resourceSignalCount: 123,
  resourceSignalTimeout: cdk.Duration.minutes(30),
  rollingUpdateConfiguration: {
    maxBatchSize: 123,
    minInstancesInService: 123,
    minSuccessfulInstancesPercent: 123,
    pauseTime: cdk.Duration.minutes(30),
    suspendProcesses: [autoscaling.ScalingProcess.LAUNCH],
    waitOnResourceSignals: false,
  },
  signals: signals,
  spotPrice: 'spotPrice',
  terminationPolicies: [autoscaling.TerminationPolicy.ALLOCATION_STRATEGY],
  updatePolicy: updatePolicy,
  updateType: autoscaling.UpdateType.NONE,
  vpcSubnets: {
    availabilityZones: ['availabilityZones'],
    onePerAz: false,
    subnetFilters: [subnetFilter],
    subnetGroupName: 'subnetGroupName',
    subnetName: 'subnetName',
    subnets: [subnet],
    subnetType: ec2.SubnetType.ISOLATED,
  },
};

